import Link from 'next/link';
export const ReturnModal = ({ history }) => (
    <>
        {console.log(history)}
        <div className="modal">
            <div className="podcast">
                <nav>
                    <Link>
                        <a className="close">&lt; Volver</a>
                    </Link>
                </nav>
            </div>
        </div>
    </>
);
